We always suggest preparing for your wedding dance as soon as possible. If you start right away, even as soon as you get engaged, you can relax and enjoy your lessons. In fact, many of our couples make a date-night out of their dance lessons because it gives them a chance to spend quality-time together and reconnect! ‚†Ä

